import requests from "./requests"
import { redirect } from "react-router-dom";

export async function getAllSerials() {
    requests.get('api/serials/serials/')
        .then((response) => {
            return (response)
        })
        .catch((response) => {
            console.log(response)
            return redirect("/login")
        })
}
